import React from 'react';

const TitleProductCart = () => {
    return (
        <>
            <div className='flex w-[1370px] centerAll mx-auto gap-x-64 py-5 shadow-lg mt-20'>
                <span>Product</span>
                <span>Price</span>
                <span>Quantity</span>
                <span>Subtotal</span>
            </div>
        </>
    );
};

export default TitleProductCart;
